function AddItemToTAble() {
      $(".allitem").on('click', function () {
            $('.ajax-loader').css("visibility", "visible");
            if (document.getElementById('tablenumber').innerHTML == 0) {
                  alert("Please Select Table Number");
            }
            else {
                  var itmid = this.getAttribute('id');
                  var itemname = this.getAttribute('item-name');
                  $('#item_name').val(itemname);
                  var tablenumber = document.getElementById("tablenumber").innerHTML;
                  if (itmid != 0 & tablenumber != 0) {
                        $.ajax({
                              url: "" + api + "create_trn_sale",
                              type: "POST",
                              data: {
                                    table_id: tablenumber,
                                    item_id: itmid,
                                    saleqty: "1",
                                    Remark: "Remark",
                                    type: "NEW",
                              },
                              success: function (data) {
                                    if (data.status_code == 201) {
                                          ShowTableItem();
                                    } else if (data.status_code == 200) {
                                          alert("Not Add More Item Because Transaction Number Are Generated \n Please Make Payment");
                                    } else {
                                          alert("Error occured !");
                                    }

                              },
                              error: function (jqXHR, textStatus, errorThrown) {
                                    alert('Error: ' + jqXHR.status + '\n' + errorThrown);
                              }
                        })
                  }
                  else {
                        alert('Please fill all the field !');
                  }
            }
      })
}


function input_qty(itm_id, e) {
      $('.ajax-loader').css("visibility", "visible");
      var table_id = document.getElementById('tablenumber').innerHTML;
      var item_id = itm_id
      var oldqty = parseInt($(e).attr('oldqty'));
      var newqty = parseInt($(e).val())
      var saleqty = Math.abs(newqty - oldqty);
      var QtyType = newqty > oldqty ? "PLUS" : newqty < oldqty ? "MINUS" : "";
      if (newqty <= 0) {
            $.ajax({
                  url: "" + api + "input_qty",
                  type: "POST",
                  data: {
                        table_id: table_id,
                        item_id: item_id,
                        saleqty: oldqty,
                        Remark: "Remark",
                        type: ''
                  },
                  success: function (data) {
                        if (data.status_code == 201) {
                              ShowTableItem();
                        } else if (data.status_code == 200) {
                              alert("Not Add More Item Because Transaction Number Are Generated \n Please Make Payment");
                        } else {
                              swal("Oops!", 'Network Connection Weak !', "error");
                        }
                  },
                  error: function (jqXHR) {
                        $('.ajax-loader').css("visibility", "hidden");
                        swal("Oops!", 'Network Connection Weak !', "error");
                  }
            })
      }
      else {
            $.ajax({
                  url: "" + api + "input_qty",
                  type: "POST",
                  data: {
                        table_id: table_id,
                        item_id: item_id,
                        saleqty: saleqty,
                        Remark: "Remark",
                        type: QtyType
                  },
                  success: function (data) {
                        if (data.status_code == 201) {
                              ShowTableItem();
                              $('.ajax-loader').css("visibility", "hidden");
                        } else if (data.status_code == 200) {
                              alert("Not Add More Item Because Transaction Number Are Generated \n Please Make Payment");
                        } else {
                              swal("Oops!", 'Network Connection Weak !', "error");
                        }
                  },
                  error: function (jqXHR, textStatus) {
                        $('.ajax-loader').css("visibility", "hidden");
                        swal("Oops!", 'Network Connection Weak !', "error");
                  }
            })
      }
}


