function DeleteItem(itm_id) {
      swal.fire({
            title: "Delete",
            text: "Are Sure You Want To Delete This Item ?",
            type: "warning",
            buttonsStyling: true,
            showCancelButton: true,
            confirmButtonText: "Yes",
            cancelButtonText: "No",
            closeOnConfirm: false,
            closeOnCancel: false,
            showLoaderOnConfirm: true
      }).then(function (result) {
            if (result.value) {
                  $('.ajax-loader').css("visibility", "visible");
                  var tablenumber = document.getElementById("tablenumber").innerHTML;
                  $.ajax({
                        url: "" + api + "create_trn_sale",
                        type: "POST",
                        data: {
                              table_id: tablenumber,
                              item_id: itm_id,
                              Remark: "Remark",
                              type: "DELETE",
                        },
                        cache: false,
                        success: function (data) {
                              ShowTableItem()
                              $('.ajax-loader').css("visibility", "hidden");
                        },
                        error: function (jqXHR, textStatus, errorThrown) {
                              swal("Oops!", 'Network Connection Weak !', "error");
                        }
                  })
            }
            else {
                  swal.close();
            }
      })
}


