let active = 'CASH'
function ShowAmount() {
      if (document.getElementById("amount_1").value == null || document.getElementById("amount_1").value == "") {
            amountvalue = '0.00';
            $('#paying').text("â‚¹ " + parseFloat(amountvalue).toFixed(2))
            var totalpay = document.getElementById('hidetotalvalue').innerHTML
            balance = totalpay - amountvalue
            $('#balance').text("â‚¹ " + parseFloat(balance).toFixed(2));
            change_return = '0.00'
            $(".sales_div_change_return").html("â‚¹ " + parseFloat(change_return).to_Fixed(2))
      }
      else {
            if (active == 'CASHBANK') {
                  amountvalue = document.getElementById("amount_1").value;
                  bankvalue = document.getElementById('bank_1').value
                  if (bankvalue == '' || amountvalue == '') {
                        var total = parseInt(amountvalue) + 0
                  }
                  else {
                        var total = parseInt(amountvalue) + parseInt(bankvalue)
                  }
                  $("#paying").text("â‚¹ " + parseFloat(total).toFixed(2));
                  totalpay = document.getElementById('hidetotalvalue').innerHTML
                  var balance = totalpay - total;
                  var change_return = 0
                  if (balance < 0) {
                        change_return = Math.abs(parseFloat(balance));
                        balance = 0;
                  }
                  else {
                        change_return = '0.00'
                  }
                  $('#balance').text("â‚¹ " + parseFloat(balance).toFixed(2));
                  $(".sales_div_change_return").html("â‚¹ " + parseFloat(change_return).toFixed(2));
            }
            else {
                  amountvalue = document.getElementById("amount_1").value;
                  $("#paying").text("â‚¹ " + parseFloat(amountvalue).toFixed(2));
                  totalpay = document.getElementById('hidetotalvalue').innerHTML
                  var balance = totalpay - amountvalue
                  var change_return = 0
                  if (balance < 0) {
                        change_return = Math.abs(parseFloat(balance));
                        balance = 0;
                  }
                  else {
                        change_return = '0.00'
                  }

                  $('#balance').text("â‚¹ " + parseFloat(balance).toFixed(2));
                  $(".sales_div_change_return").html("â‚¹ " + parseFloat(change_return).toFixed(2));
            }

      }
}


function AddDiscount() {
      var tablenumber = document.getElementById("tablenumber").innerHTML;
      $.ajax({
            url: "" + api + "find_trn_sale",
            type: "GET",
            data: {
                  table_id: tablenumber
            },
            success: function (data) {
                  var objdata = JSON.stringify(data.data);
                  var objectdata = JSON.parse(objdata);
                  for (var i = 0; i < objectdata.length; i++) {
                        var type = $('#select').find(':selected').html();
                        if (type == 'Per%') {
                              var grossamt = document.getElementById('total_rate').value;
                              var per = document.getElementById('discount_input').value;
                              var rate = objectdata[i].GrossAmount * per / 100;
                              $.ajax({
                                    url: "" + api + "create_trn_sale",
                                    type: "POST",
                                    data: {
                                          table_id: tablenumber,
                                          item_id: objectdata[i].Item_ID,
                                          discountper: per,
                                          type: "DISCOUNT",
                                    },
                                    cache: false,
                                    success: function (data) {
                                          if (data.status_code == 201) {
                                                document.getElementById("discount_input").value = ' ';
                                                $("#discount-modal").hide()
                                                ShowTableItem()
                                          }
                                          else {
                                                alert('Error Occured !')
                                          }

                                    }
                              })
                        }
                        else {
                              var grossamt = document.getElementById('total_rate').value;
                              var rate = document.getElementById('discount_input').value;
                              var per = rate / grossamt * 100;
                              $.ajax({
                                    url: "" + api + "create_trn_sale",
                                    type: "POST",
                                    data: {
                                          table_id: tablenumber,
                                          item_id: objectdata[i].Item_ID,
                                          discountper: per,
                                          type: "DISCOUNT",
                                    },
                                    cache: false,
                                    success: function (data) {
                                          if (data.status_code == 201) {
                                                document.getElementById("discount_input").value = ' ';
                                                $("#discount-modal").hide();
                                                ShowTableItem()
                                          }
                                          else {
                                                alert('Error Occured !')
                                          }

                                    }
                              })
                        }


                  }
            }
      })
}

function PaymentType() {
      var totalvalue = document.getElementById('hidetotalvalue').innerHTML;
      $('#amount_1').val(totalvalue)
      $('#paying').text("â‚¹ " + parseFloat(totalvalue).toFixed(2))
      $('[name=Rechargeoptions]').click(function () {

            $('#change_return').html("â‚¹ 0.00")
            $('#paying').html("â‚¹ " + "0.00")
            $('#amount_1').val(0);
            $('#bank_1').val(0);
            $('#bankvalue').val(0)
            var total = $('#hidetotalvalue').text();
            $('#balance').html("â‚¹ " + total)
            valueget = $(this).data("value")
            switch (valueget) {
                  case 'CASH':
                        {
                              var totalvalue = document.getElementById('hidetotalvalue').innerHTML;
                              $('#amount_1').val(totalvalue)
                              $('#type').text('Cash Amount')
                              $('[data-value=CASH]').addClass('active'); $('[data-value=CASHBANK], [data-value=BANK]').removeClass('active');
                              $('[data-name=CashAmount]').show()
                              $('[data-name=OnlineAmount]').hide()
                              $('[data-name = refnumber]').hide()
                              active = 'CASH'
                              ShowAmount()
                              break;
                        }
                  case 'BANK':
                        {
                              var totalvalue = document.getElementById('hidetotalvalue').innerHTML;
                              $('#amount_1').val(totalvalue)
                              $('#type').text('Online Amount')
                              $('[data-value=BANK]').addClass('active'); $('[data-value=CASH], [data-value=CASHBANK]').removeClass('active');
                              $('[data-name=CashAmount]').show()
                              $('[data-name=OnlineAmount]').hide()
                              $('[data-name = refnumber]').show()
                              active = 'BANK';
                              ShowAmount()
                              break;
                        }
                  case 'CASHBANK':
                        {
                              $('#type').text('Cash Amount')
                              $('[data-value=CASHBANK]').addClass('active'); $('[data-value=CASH], [data-value=BANK]').removeClass('active');
                              $('[data-name=OnlineAmount]').show()
                              $('[data-name = refnumber]').show()
                              active = 'CASHBANK'
                              break;
                        }
                  default:
                        {
                              break;
                        }

            }
      })
}


